Tai buvo pirmasis „Energijos“ pralaimėjimas Lietuvos čempionatuose nuo 2012 metų kovo mėnesio. Pergalingą įvartį šeimininkams paskutinę mačo sekundę pelnė Ilja Lašinas. Pirmąjį kelinį „Energija“ laimėjo 2:0 po Dovydo Kulevičiaus ir Danieliaus Nomanovo įvarčių. Kelinio pabaigoje rezultatą sušvelnino Remigijus Guoga. Antrajame kėlinyje I. Lašinas rezultatą išlygino, o Dmitrijus Prokopenkovas išvedė „Kauno Hockey“ ekipą iš priekį. Trečiojo kėlinio pradžioje tas pats D. Prokopenkovas padvigubino Kauno komandos pranašumą, bet Mantas Marcinkevičius ir  Rolandas Aliukonis  tiksliais smūgiais atstatė pusiausvyrą. Galiausiai, jau atrodžius, kad komandoms teks žaisti pratęsimą, paskutinės atakos metu I. Lašinas padovanojo „Kauno Hockey“ klubui sensacingą pergalę. „Kauno Hockey“ klubas su 18 taškų po aštuonerių rungtynių tapo čempionato lyderiu. „Energija“ (6 rungt./15 tšk.) atsidūrė antroje pozicijoje. (function(d, s, i, r) {
